           <h3>Core Principles</h3>
           <p>We are committed to helping develop an open network based on open-source technologies. To this end, we commit to the following principles:</p>

           <ul>
               
                <li>Compliance with the <a href="https://tbnoa.org/details.html?docid=6">Telos Network Operating Agreement.</a></li>
                <li>High uptime and availability.</li>
                <li>Open-source all the things.</li>
                <li>Compliance with local regulations and laws.</li>
                <li>A spirit of cooperation and brotherhood within the community.</li>
                <li>A focus on sustainability and a green future.</li>

           </ul>

           <h3>Block Production</h3>
           <p>We commit to provide the highest quality infrastructure for block production, peering, and other network services. We have a deep understanding of what makes for good service, and we have leveraged that experience to deploy to both the Telos Testnet and the Telos Mainnet.</p>

           <h3>Services Provided</h3>
           <p>As part of our larger strategy to improve the quality of the applications deployed to the Mainnet, Nodenode is committing to provide the following services to qualifying projects.</p>

           <ul>
               
                <li>Design</li>
                <li>User experience</li>
                <li>Interface design</li>
                <li>Branding</li>
                <li>Marketing</li>
                <li>Product conceptualization</li>
                <li>Community engagement</li>
                <li>Product marketing</li>

           </ul>

           <h3>Project Selection Criteria</h3>
           <p>Qualifying projects are selected from the pool of applicants. They must have the following features:</p>

           <ul>
               
                <li>Impact on the network ecosystem</li>
                <li>User growth potential</li>
                <li>Project complexity</li>
                <li>Current userbase</li>
                <li>Global impact</li>
                <li>Long-term plan</li>

           </ul>

           <h3>Submit your project</h3>
           <p>If you believe that your project fulfills these criteria, we should begin with a <nuxt-link to="/schedule">discussion</nuxt-link>.</p>

